INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 1, 91002, 150, 107501, 0, "ぺコリーヌ", 37, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 1, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 1, 91002, 150, 107601, 0, "コッコロ", 38, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 2, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 1, 91002, 150, 107801, 0, "キャル", 39, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 3, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 1, 91002, 150, 107701, 0, "スズメ", 40, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 4, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 1, 91002, 150, 107901, 0, "タマキ", 41, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 5, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 2, 91002, 150, 107501, 0, "ぺコリーヌ", 42, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 6, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 2, 91002, 150, 107601, 0, "コッコロ", 43, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 7, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 2, 91002, 150, 107801, 0, "キャル", 44, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 2, 91002, 150, 107701, 0, "スズメ", 45, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 9, 40001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (8, 2, 91002, 150, 107901, 0, "タマキ", 46, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 10, 40001);
